#
# Structure for table "servicos"
#

DROP TABLE IF EXISTS `servicos`;
CREATE TABLE `servicos` (
  `id_servico` int(11) NOT NULL AUTO_INCREMENT,
  `id_equipamento` int(11) NOT NULL,
  `nome` varchar(50) NOT NULL,
  `preco` double NOT NULL DEFAULT '0',
  PRIMARY KEY (`id_servico`),
  KEY `servico_no_equipamento_idx` (`id_equipamento`),
  CONSTRAINT `servico_no_equipamento` FOREIGN KEY (`id_equipamento`) REFERENCES `equipamentos` (`id_equipamento`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "servicos"
#


#
# Structure for table "solicitacoes"
#

DROP TABLE IF EXISTS `solicitacoes`;
CREATE TABLE `solicitacoes` (
  `id_solicitacao` int(11) NOT NULL AUTO_INCREMENT,
  `id_equipamento` int(11) NOT NULL COMMENT '1 - Rigaku (DMAXB)\n2 - PANalytical (X’Pert PRO MPD)\n3 - Rigaku (ZSX-Mini)',
  `id_fenda` int(11) DEFAULT NULL,
  `data_solicitacao` datetime DEFAULT NULL,
  `data_conclusao` datetime DEFAULT NULL,
  `tempo_analise` float DEFAULT NULL COMMENT 'tempo de análise em minutos',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '1 - Aguardando autorização do professor\n2 - Aguardando aprovação do laboratório\n3 - Aguardando confirmação de entrega da amostra\n4 - Na fila do equipamento\n5 - Em processo de análise\n6 - Análise Concluída. Aguardando recuperação da amostra.\n7 - Solicitação finalizada.\n\n-1 - Cancelada pelo responsável.\n-2 - Cancelada pelo operador.\n-3 - Cancelada por falta de entrega da amostra.',
  `configuracao` varchar(100) NOT NULL DEFAULT '' COMMENT 'FRX: {resultado:;medida:} DRX: {tipo_analise:;condicao:;velocidade:;fixed_time:;2theta_inicial:;2theta_final:;delta_2theta:}',
  `identificacao_da_amostra` varchar(50) NOT NULL,
  `composicao` varchar(50) NOT NULL,
  `tipo` int(1) NOT NULL DEFAULT '0' COMMENT '1 - Pó\n2 - Filmes\n3 - Pastilhas\n4 - Eletrodo\n5 - Outro',
  `tipo_outro` varchar(50) DEFAULT NULL,
  `data_recebimento` datetime DEFAULT NULL,
  `inflamavel` tinyint(1) NOT NULL DEFAULT '0',
