#
# Structure for table "solicitacoes_comerciais"
#

DROP TABLE IF EXISTS `solicitacoes_comerciais`;
CREATE TABLE `solicitacoes_comerciais` (
  `id_solicitacao` int(11) NOT NULL,
  `id_empresa` int(11) NOT NULL,
  `id_responsavel_financeiro` int(11) NOT NULL,
  PRIMARY KEY (`id_solicitacao`),
  KEY `responsavel_idx` (`id_empresa`),
  KEY `responsavel_financeiro_idx` (`id_responsavel_financeiro`),
  CONSTRAINT `a_solicitacao_comercial` FOREIGN KEY (`id_solicitacao`) REFERENCES `solicitacoes` (`id_solicitacao`) ON UPDATE CASCADE,
  CONSTRAINT `responsavel` FOREIGN KEY (`id_empresa`) REFERENCES `empresas` (`id_empresa`) ON UPDATE CASCADE,
  CONSTRAINT `responsavel_financeiro` FOREIGN KEY (`id_responsavel_financeiro`) REFERENCES `empresas` (`id_empresa`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

