# Structure for table "usuario_esta_em_projeto"
#

DROP TABLE IF EXISTS `usuario_esta_em_projeto`;
CREATE TABLE `usuario_esta_em_projeto` (
  `id_projeto` int(11) NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `data_ingresso` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id_projeto`,`id_usuario`),
  KEY `projeto_tem_usuario_idx` (`id_usuario`),
  CONSTRAINT `projeto_tem_usuario` FOREIGN KEY (`id_usuario`) REFERENCES `usuarios` (`id_usuario`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `usuario_esta_em_projeto` FOREIGN KEY (`id_projeto`) REFERENCES `projetos` (`id_projeto`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

