# Structure for table "usuario_tem_mensagem"
#

DROP TABLE IF EXISTS `usuario_tem_mensagem`;
CREATE TABLE `usuario_tem_mensagem` (
  `id_usuario` int(11) NOT NULL,
  `id_mensagem` int(11) NOT NULL,
  `lida` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id_usuario`,`id_mensagem`),
  KEY `fk_mensagem_que_o_usuario_tem_idx` (`id_mensagem`),
  CONSTRAINT `fk_mensagem_que_o_usuario_tem` FOREIGN KEY (`id_mensagem`) REFERENCES `mensagens` (`id_mensagem`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_usuario_que_tem_mensagem` FOREIGN KEY (`id_usuario`) REFERENCES `usuarios` (`id_usuario`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

