#
# Structure for table "usuarios"
#

DROP TABLE IF EXISTS `usuarios`;
CREATE TABLE `usuarios` (
  `id_usuario` int(11) NOT NULL AUTO_INCREMENT,
  `cpf` varchar(11) NOT NULL,
  `nome` varchar(90) NOT NULL,
  `email` varchar(90) NOT NULL,
  `senha` varchar(90) NOT NULL,
  `estado` varchar(2) DEFAULT NULL,
  `cidade` varchar(90) DEFAULT NULL,
  `departamento` varchar(90) DEFAULT NULL,
  `laboratorio` varchar(90) DEFAULT NULL,
  `area_de_pesquisa` varchar(90) DEFAULT NULL,
  `telefone` varchar(90) NOT NULL,
  `email_alternativo` varchar(90) DEFAULT NULL,
  `nivel_acesso` int(11) NOT NULL DEFAULT '1' COMMENT '1 - Aluno\n2 - Professor\n3 - Responsável por empresa\n4 - Financeiro\n5 - Operador\n6 - Administrador',
  `permissao_drx` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-Não,1-Sim',
  `permissao_frx` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-Não,1-Sim',
  `uid` varchar(90) NOT NULL,
  `confirmado` int(1) NOT NULL DEFAULT '0' COMMENT '0 - não confirmado\n1 - email enviado\n2 - confirmado',
  `email_confirmado` int(1) DEFAULT '0',
  `titulo` int(1) DEFAULT '0' COMMENT '0 - Graduando1 - Graduado2 - Especializando3 - Especialista4 - Mestrando5 - Mestre6 - Doutorando7 - Doutor',
  `genero` int(1) NOT NULL DEFAULT '1' COMMENT '1 - Masculino\n2 - Feminino',
  `limite` int(11) DEFAULT '20',
  `ies` varchar(90) DEFAULT NULL,
  `saudacao` int(1) DEFAULT '0' COMMENT '0 - Sr/Sra\n1 - Profº/Profª\n2 - Dr/Dra',
  PRIMARY KEY (`id_usuario`)
) ENGINE=InnoDB AUTO_INCREMENT=525 DEFAULT CHARSET=utf8;

