#
# Structure for table "pesquisadores"
#

DROP TABLE IF EXISTS `pesquisadores`;
CREATE TABLE `pesquisadores` (
  `id_pesquisador` int(11) NOT NULL,
  `id_empresa` int(11) NOT NULL,
  KEY `id_pesquisador` (`id_pesquisador`,`id_empresa`),
  KEY `id_empresa` (`id_empresa`),
  CONSTRAINT `pesquisadores_ibfk_1` FOREIGN KEY (`id_pesquisador`) REFERENCES `usuarios` (`id_usuario`),
  CONSTRAINT `pesquisadores_ibfk_2` FOREIGN KEY (`id_empresa`) REFERENCES `empresas` (`id_empresa`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "pesquisadores"
#


#
# Structure for table "mensagens"
#

DROP TABLE IF EXISTS `mensagens`;
CREATE TABLE `mensagens` (
  `id_mensagem` int(11) NOT NULL AUTO_INCREMENT,
  `id_operador` int(11) NOT NULL,
  `data_envio` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `mensagem` varchar(50) NOT NULL,
  PRIMARY KEY (`id_mensagem`),
  KEY `enviada_por_idx` (`id_operador`),
  CONSTRAINT `enviada_por` FOREIGN KEY (`id_operador`) REFERENCES `usuarios` (`id_usuario`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

