# Data for table "mensagens"
#


#
# Structure for table "empresa_tem_mensagem"
#

DROP TABLE IF EXISTS `empresa_tem_mensagem`;
CREATE TABLE `empresa_tem_mensagem` (
  `empresas_id_empresa` int(11) NOT NULL,
  `mensagens_id_mensagem` int(11) NOT NULL,
  `lida` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`empresas_id_empresa`,`mensagens_id_mensagem`),
  KEY `fk_empresas_has_mensagens_mensagens1_idx` (`mensagens_id_mensagem`),
  KEY `fk_empresas_has_mensagens_empresas1_idx` (`empresas_id_empresa`),
  CONSTRAINT `fk_empresas_has_mensagens_empresas1` FOREIGN KEY (`empresas_id_empresa`) REFERENCES `empresas` (`id_empresa`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_empresas_has_mensagens_mensagens1` FOREIGN KEY (`mensagens_id_mensagem`) REFERENCES `mensagens` (`id_mensagem`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

