#
# View "aluno"
#

DROP VIEW IF EXISTS `aluno`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `aluno`
  AS
  SELECT
    `u`.`id_usuario` AS 'id_aluno',
    `u`.`nome`,
    `u`.`email`,
    `u`.`email_alternativo`,
    `u`.`telefone`,
    `a`.`id_professor`
  FROM
    (`usuarios` u
      JOIN `alunos` a)
  WHERE
    (`u`.`id_usuario` = `a`.`id_aluno`);

#
# View "professor"
#

DROP VIEW IF EXISTS `professor`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `professor`
  AS
  SELECT
    `u`.`id_usuario` AS 'id_professor',
    `u`.`nome`,
    `u`.`email`,
    `u`.`email_alternativo`,
    `u`.`telefone`
  FROM
    (`usuarios` u
      JOIN `professores` p)
  WHERE
    (`u`.`id_usuario` = `p`.`id_professor`);

#
# Trigger "remove_user"
#

DROP TRIGGER IF EXISTS `remove_user`;
CREATE TRIGGER `remove_user` BEFORE DELETE ON `usuarios` FOR EACH ROW BEGIN
    DELETE FROM professores WHERE id_professor=OLD.id_usuario;
    DELETE FROM alunos WHERE id_professor=OLD.id_usuario;
    
    DELETE FROM alunos WHERE id_aluno=OLD.id_usuario;
    
    /*DELETE FROM solicitacoes_academicas where solicitacoes_academicas.id_usuario=OLD.id_usuario*/
END;
